    this.color = new THREE.Color(
      (color === null) ? (Math.random() * 0xffffff) : color
    );

    // set direction
    let speed = blockConfig.initSpeed + blockConfig.acceleration;
    speed = Math.min(speed, blockConfig.maxSpeed);
